  false,\n\t\"url\": null,\n\t\"notes\": \"During avifaunal investigations at Buldir
  Island 1974-1976, some aspects of the biology of Crested, Least, and Whiskered Auklets
  were investigated in a colony where all three species nested. This paper summarizes
  data on breeding chronology, nest site characteristics, diurnal rhythms, mensural
  characteristics, and productivity of the three Aethia. Comparisons are made among
  the three species and with data from St. Lawrence Island and the Commander Islands.\",\n\t\"license_title\":
